import React from 'react'
import Navbar from '../components/Navbar';
import Cards from '../components/Cards';
import HeroSection from '../components/HeroSection'



const Home = () => {
     
  return (
    <>
    <div>
      <Navbar />
      <img src='images/hr.png' alt="Commission" />
      <Cards />
    </div>
    </>
  )
}

export default Home
